/* import axios from "axios"
import { api } from "../../../config" */

export const getCliente = async () =>{
    await axios.get(`${api}/cliente/${id}`)
    .then((response) =>{
        setInfoC(response.data.cliente)
    }).catch(()=>{
        setStatus({
            type:'error',
            message:'Não foi possível encontrar o cliente.'
        })
    })
}
